import React from 'react';
// import ReactDOM from 'react-dom';
import App from './App';
import Input from './components/Input'
import Button from './components/Button'

ReactDOM.render(
  <React.StrictMode>
    <App />
    <Input />
    <Button />
  </React.StrictMode>,
  document.getElementById('root')
);
